- input: TEXT,F3XA,,"The Democratic Party of Oregon is in receipt of your letters
    dated October 8 2003 and October 22 2003 regarding the committee's 2003 Mid-Year
    report. Please note that the no employee of the committee spent more than 25%
    of their time in any given month working on any Federal Election Activity or activities
    in connection with a Federal Election. Therefore salary payments were made directly
    from a non-federal account.Schedule H1 was accidentally excluded with the original
    filing but is included in this filing. Administrative expenses paid during this
    period were paid using three different allocation ratios. One for pre-election
    2002 expenses (Admin 01/02). One for post-election 2002 expenses (Admin 02/2).
